import React, {useEffect, useState} from 'react';
import { fetchCoaches } from '../api';
import { Link } from 'react-router-dom';

export default function Coaches(){
  const [coaches,setCoaches]=useState([]);
  useEffect(()=>{ fetchCoaches().then(setCoaches).catch(()=>setCoaches([])); },[]);

  return (
    <div>
      <h2>Coaches</h2>
      {coaches.length===0 && <div>No coaches found</div>}
      {coaches.map(c=> (
        <div key={c.id} className="card">
          <div style={{display:'flex', justifyContent:'space-between'}}>
            <div>
              <h3>{c.username}</h3>
              <div className="muted">{c.specialty}</div>
            </div>
            <div>
              <Link to={`/book/${c.id}`} className="btn">Book</Link>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
}
